#Funciones que recorren los diccionarios y añaden números gráficamente
def numeros_iniciales(d):
    l= list(d.keys())
    index = 0
    basey = 0.0175
    basex = 0.06
    dif = 0.11
    for i in d:
        if d.get(i) == 1:
            if l[index][0] == 'A':
                numero = 1
            elif l[index][0] == 'B':
                numero = 2
            elif l[index][0] == 'C':
                numero = 3
            elif l[index][0] == 'D':
                numero = 4
            elif l[index][0] == 'E':
                numero = 5
            elif l[index][0] == 'F':
                numero = 6
            elif l[index][0] == 'G':
                numero = 7
            elif l[index][0] == 'H':
                numero = 8
            elif l[index][0] == 'I':
                numero = 9
            if len(l[index]) == 2:
                casilla = int(l[index][1])
            else:
                casilla = int(l[index][1]+l[index][2])
            if 0<casilla<10:
                y = basey + 8*dif
            elif 9<casilla<19:
                y = basey + 7*dif
            elif 18<casilla<28:
                y = basey + 6*dif
            elif 27<casilla<37:
                y = basey + 5*dif
            elif 36<casilla<46:
                y = basey + 4*dif
            elif 45<casilla<55:
                y = basey + 3*dif
            elif 54<casilla<64:
                y = basey + 2*dif
            elif 63<casilla<73:
                y = basey + dif
            elif 72<casilla<82:
                y = basey
            if casilla % 9 == 1:
                x = basex
            elif casilla % 9 == 2:
                x = basex + dif
            elif casilla % 9 == 3:
                x = basex + 2*dif
            elif casilla % 9 == 4:
                x = basex + 3*dif
            elif casilla % 9 == 5:
                x = basex + 4*dif
            elif casilla % 9 == 6:
                x = basex + 5*dif
            elif casilla % 9 == 7:
                x = basex + 6*dif
            elif casilla % 9 == 8:
                x = basex + 7*dif
            elif casilla % 9 == 0:
                x = basex + 8*dif
            label = ax.annotate(numero, xy = (x,y), fontsize = 25, ha = "center")
        index+=1

